import React, { Component } from 'react';
import '../../App.css';
import Title from '../titles/contact';
import Link from '@material-ui/core/Link';
import LinkedInIcon from '@material-ui/icons/LinkedIn';
import Show from '../contactShow/index'

export default class Contact extends Component{
    render() {
        return(
            <>
                <center><Title/></center>
                <p className="project-main-text">
                    To reach me, feel free to connect with me on LinkedIn. Alternatively, you can text/call me or send me an email.
                </p>
                <center><Show/></center>

            </>

        )
    }
}
